-- Function to copy the link and send a notification
local function copyLink()
    local link = "https://discord.gg/tHS3XP45AG"  -- Define your link here
    setclipboard(link)  -- Copy the link to the clipboard

    -- Send a notification about the key being copied
    game.StarterGui:SetCore("SendNotification", {
        Title = "Copied",
        Text = "Key has been copied to clipboard",
        Duration = 5
    })
end

-- Function to verify the entered key and send the appropriate notification
local correctKey = "Zyren"  -- Define the correct key
local function verifyKey()
    local enteredKey = keyTextBox.Text  -- Get the entered text
    if enteredKey == correctKey then
        -- Key is correct, send a success notification
        game.StarterGui:SetCore("SendNotification", {
            Title = "Valid",
            Text = "Key is valid! Enjoy!",
            Duration = 5
        })
        frame.Visible = false 
        wait(2)
