-- Make the frame draggable (from anywhere on the frame except buttons)
local dragToggle = nil
local dragStart = nil
local dragPos = nil

-- Function to begin dragging the frame
frame.InputBegan:Connect(function(input)
    -- Only start dragging if the input is from the frame itself, not the buttons
    if input.UserInputType == Enum.UserInputType.MouseButton1 and not button:IsPointInRegion3(input.Position) then
        dragToggle = true
        dragStart = input.Position - frame.Position
        input.Consumed = true
    end
end)

-- Function to stop dragging the frame
frame.InputEnded:Connect(function(input)
    if input.UserInputType == Enum.UserInputType.MouseButton1 then
        dragToggle = false
    end
end)

-- Function to update the frame's position while dragging
game:GetService("UserInputService").InputChanged:Connect(function(input)
    if dragToggle then
        dragPos = input.Position - dragStart
        frame.Position = UDim2.new(0, dragPos.X, 0, dragPos.Y)
    end
end)

